   Drop database if it exists
********************************************************************************/
IF EXISTS (SELECT name FROM master.dbo.sysdatabases WHERE name = N'PE_DBI202_Su2024')
BEGIN
	ALTER DATABASE PE_DBI202_Su2024 SET OFFLINE WITH ROLLBACK IMMEDIATE;
	ALTER DATABASE PE_DBI202_Su2024 SET ONLINE;
	DROP DATABASE PE_DBI202_Su2024;
END

