CREATE DATABASE PE_DBI202_Su2024
GO

USE PE_DBI202_Su2024
GO

/*******************************************************************************
	Drop tables if exists
*******************************************************************************/
DECLARE @sql nvarchar(MAX) 
SET @sql = N'' 

SELECT @sql = @sql + N'ALTER TABLE ' + QUOTENAME(KCU1.TABLE_SCHEMA) 
    + N'.' + QUOTENAME(KCU1.TABLE_NAME) 
    + N' DROP CONSTRAINT ' -- + QUOTENAME(rc.CONSTRAINT_SCHEMA)  + N'.'  -- not in MS-SQL
    + QUOTENAME(rc.CONSTRAINT_NAME) + N'; ' + CHAR(13) + CHAR(10) 
FROM INFORMATION_SCHEMA.REFERENTIAL_CONSTRAINTS AS RC 

INNER JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE AS KCU1 
    ON KCU1.CONSTRAINT_CATALOG = RC.CONSTRAINT_CATALOG  
    AND KCU1.CONSTRAINT_SCHEMA = RC.CONSTRAINT_SCHEMA 
    AND KCU1.CONSTRAINT_NAME = RC.CONSTRAINT_NAME 

EXECUTE(@sql) 

GO
DECLARE @sql2 NVARCHAR(max)=''

SELECT @sql2 += ' Drop table ' + QUOTENAME(TABLE_SCHEMA) + '.'+ QUOTENAME(TABLE_NAME) + '; '
FROM   INFORMATION_SCHEMA.TABLES
WHERE  TABLE_TYPE = 'BASE TABLE'

Exec Sp_executesql @sql2 
GO 

---------------------------- Create table ----------------------------------
CREATE TABLE Authors (
    AuthorID INT PRIMARY KEY,
    AuthorName NVARCHAR(100),
    Country NVARCHAR(100), 
    Sex NVARCHAR(10), 
    YearOfBirth INT 
);

CREATE TABLE Genres (
    GenreID INT PRIMARY KEY,
    GenreName NVARCHAR(50) unique
);

CREATE TABLE Books (
    BookID INT PRIMARY KEY,
    Title NVARCHAR(200),
    AuthorID INT FOREIGN KEY REFERENCES Authors(AuthorID),
    PublicationYear INT,
    ISBN NVARCHAR(20),
    GenreID INT FOREIGN KEY REFERENCES Genres(GenreID)
);

CREATE TABLE BookCopies (
    CopyID INT PRIMARY KEY,
    BookID INT FOREIGN KEY REFERENCES Books(BookID)
);

CREATE TABLE Members (
    MemberID INT PRIMARY KEY,
    MemberName NVARCHAR(100),
    Address NVARCHAR(200),
    Email NVARCHAR(100),
	Sex NVARCHAR(20),
	BirthDate date
);

CREATE TABLE Loans (
    LoanID INT PRIMARY KEY,
    MemberID INT FOREIGN KEY REFERENCES Members(MemberID),
    LoanDate DATE,
    DueDate DATE
);

CREATE TABLE LoanDetails (
    LoanDetailID INT PRIMARY KEY,
	LoanID INT FOREIGN KEY REFERENCES Loans(LoanID),
    CopyID INT FOREIGN KEY REFERENCES BookCopies(CopyID),
	ReturnDate DATE
);

